import { Route, Routes } from "react-router-dom";
import "./App.css";
// import Body from "./components/Body";
import Header from "./components/Header";
import All from "./components/MailType/All";
import WriteEmail from "./components/MailType/WriteEmail";
import SideBar from "./components/SideBar";

function App() {
  return (
    <>
      <Header />
      <div className="flex">
        <SideBar />
        <Routes className="mail items-center border-b-[0.1px] relative border-gray-200">
          <Route path="/" element={<All />} />
          <Route path="/write" element={<WriteEmail />} />
          {/* <Body /> */}
        </Routes>
      </div>
    </>
  );
}

export default App;
